import React, {Component} from 'react';
import './css/UploadBackground.css';

class UploadBackground extends Component {

  render() {
    return (
      <>
        {this.props.uplBg ? <>
          <div onClick={this.props.toggleUpload} className='upload-wrapper'>
            <div className="upload-content">Some stuff</div> 
          </div>
          <div className="black-wrapper"></div>
        </> : ''}
      </>
    )
  }
}

export default UploadBackground;
